[{"location":"DocsGeneral/#DryTooling.General","page":"General","title":"DryTooling.General","text":"","category":"section"},{"location":"DocsGeneral/","page":"General","title":"General","text":"CurrentModule = DryTooling.General","category":"page"},{"location":"DocsGeneral/","page":"General","title":"General","text":"","category":"page"},{"location":"DocsGeneral/","page":"General","title":"General","text":"Modules = [\n    DryTooling.General\n]","category":"page"},{"location":"DocsKramers/#DryTooling.Kramers","page":"Kramers","title":"DryTooling.Kramers","text":"","category":"section"},{"location":"DocsKramers/","page":"Kramers","title":"Kramers","text":"CurrentModule = DryTooling.Kramers","category":"page"},{"location":"DocsKramers/","page":"Kramers","title":"Kramers","text":"Implements the ordinary differential equation for prediction of bed height profile in a rotary kiln as proposed by Kramers and Croockewite (1952) [1]. Its goal is to be used as a process support tool or to integrate more complex models requiring integration of the bed profile.","category":"page"},{"location":"DocsKramers/","page":"Kramers","title":"Kramers","text":"","category":"page"},{"location":"DocsKramers/","page":"Kramers","title":"Kramers","text":"Modules = [\n    DryTooling.Kramers,\n]","category":"page"},{"location":"DocsKramers/","page":"Kramers","title":"Kramers","text":"[1]: Kramers et al., 1952","category":"page"},{"location":"DocsIdealGas/#DryTooling.IdealGas","page":"IdealGas","title":"DryTooling.IdealGas","text":"","category":"section"},{"location":"DocsIdealGas/","page":"IdealGas","title":"IdealGas","text":"CurrentModule = DryTooling.IdealGas","category":"page"},{"location":"DocsIdealGas/","page":"IdealGas","title":"IdealGas","text":"","category":"page"},{"location":"DocsIdealGas/","page":"IdealGas","title":"IdealGas","text":"Modules = [\n    DryTooling.IdealGas\n]","category":"page"},{"location":"DocsTransport/#DryTooling.Transport","page":"Transport","title":"DryTooling.Transport","text":"","category":"section"},{"location":"DocsTransport/","page":"Transport","title":"Transport","text":"CurrentModule = DryTooling.Transport","category":"page"},{"location":"DocsTransport/","page":"Transport","title":"Transport","text":"","category":"page"},{"location":"DocsTransport/","page":"Transport","title":"Transport","text":"Modules = [\n    DryTooling.Transport\n]","category":"page"},{"location":"#DryTooling","page":"Home","title":"DryTooling","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for DryTooling.","category":"page"},{"location":"","page":"Home","title":"Home","text":"I am often faced with using the same approach for different engineering and scientific problems, but I don't like repeating the same task again and again. This is where DryTooling.jl comes in. By adopting some principles of DRY in Julia, to a larger extent than its definition, it packages together models and workflows that are not available or validated elsewhere - and in some cases adapts existing models. The tools will progressively cover a broad range of numerical applications and data treatment, this package is in its early days from the migration of my old Python scripts and packages.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Also dry tooling is my favorite sport!","category":"page"},{"location":"#Citing","page":"Home","title":"Citing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"See CITATION.bib for the relevant reference(s).","category":"page"}]
